import React from 'react';
import { ReactDOM } from 'react-dom';
import homeProfileImg from './home-imgs/home-profile-img.JPG';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
// import { Switch } from 'react-router';
// import './App.css';
// import { ImageGroup } from 'semantic-ui-react';
import './NavBar.css';
import ResumePage from './Pages/ResumePage.js';
import NewPage from './NewPage';
import Home from './Pages/Home';


function App() {
  return (
    <Router>
    <nav className="navigation-bar">
            <div className='left-nav'>
              <div className='tiny-circle'></div>
              <span className='myName'><Link to="/">Loveleen Bassi</Link></span>
              <span className='myJob'> Developer</span>

            </div>
            <div className='right-nav'>
              <span className='nav-links'><Link to="./Res">Resume</Link></span>
              <span className='nav-links'><a>Projects</a></span>
              <span className='nav-links'><a>Contact</a></span>
            </div>
          </nav>

    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/new-page" element={<NewPage />} />
      <Route path='resume-page' element={<NewPage />} />
    </Routes>
  </Router>
  );

}

export default App;
